import { FiSearch } from 'react-icons/fi'


function App() {
  return (
    <div className="container">
        <h1 className='title'>Buscador de CEP</h1>

        <div className='containerInput'>
          <input type="number"
          placeholder='Digite um CEP'></input>
          <button>
            <FiSearch size={25} color="#fff"></FiSearch>
          </button>
        </div>


    </div>
  );
}

export default App;
